import React from 'react';

const api = () => {
    const fetchAPI = () => {
        let data = null
        axios.get('/portal-tech-react.json')
            .then(response => this.data = response.data)
            .catch(error => console.log(error));
        return JSON.stringify(data)
    }

    return(
        <p>{toString(fetchAPI)}</p>
    )
};

export default api;
